function capitalizeAndJoin(str,fontSize) {
    let lines = str.split(",");
    let firstLineWords = lines[0].split(" ");
    let secondLineWords = lines[1].split(", ");
    let thirdLineWords = lines[2].split(", ");
    let forthLineWords = lines[3].split(", ");

    // Capitalize every word in each line and change "Coxs" to "Cox's"
    for (let i = 0; i < lines.length; i++) {
        let words = lines[i].split(" ");
        for (let j = 0; j < words.length; j++) {
            // Capitalize each word
            words[j] = words[j].charAt(0).toUpperCase() + words[j].slice(1);
            // Change "Coxs" to "Cox's"
            if (words[j].toLowerCase() === "coxs") {
                words[j] = "Cox's";
            }
        }
        // Join the words back together
        lines[i] = words.join(" ");
    }

    // Adjust "Coxsbazar" to "Cox's Bazar"
    for (let i = 0; i < forthLineWords.length; i++) {
        if (forthLineWords[i].toLowerCase() === "coxsbazar") {
            forthLineWords[i] = "Cox's Bazar";
        }
    }

    let firstLine = "<div style='color: black; font-size: 10px; text-align: center;'>" + lines[0] + ", " + lines[1] + "</div>";
    let secondLine = "<div style='color: black; font-size: 10px; text-align: center;'>" + lines[2] + ", " + forthLineWords.join(", ") + "</div>";

    // Combine the lines with appropriate line breaks
    let result = firstLine + " " + secondLine;

    return result;
}


